entry.value:
update public.metn_logdata
set ts_ingestion = to_timestamp(${now():toNumber()}/1000)
where batchid = ${batchid.0};

update public.metn_logdata
set ts_ingestion = null
where batchid = ${batchid.0};

delete from public.metn_dati dati where batchid in (
	select batchid from public.metn_logdata
	where ts_delete is not null
);

update public.metn_loganag
set ts_download = to_timestamp(${now():toNumber()}/1000)
where id = ${anagid.0};
